% Larsson's and Martyushev's 7-point method for F+f+k estimation
%
% USAGE:
%   [F, f, k, E] = Ffk7pt_LarssonMartyushev(m1, m2, c1, c2, method)
% INPUTS:
%   m1,m2 - 3x7, 2D point correspondences in homogeneous coordinates 
%   c1,c2 - 1x2, image center of each camera
%   method - "larsson" or "martyushev"
% OUTPUTS:
%   F - 3x3xM, fundamental matrix
%   f - 1xM, focal length
%   k - 1xM, radial lens distortion
%   E - 3x3xM, essential matrix
%   (0 <= M <= 68)
% REFERENCE:
%   V. Larsson et al., "Efficient Solvers for Minimal Problems by Syzygy-based Reduction," CVPR 2017.  
%   E. Martyushev et al., "Optimizing elimination templates by greedy parameter search," CVPR2022.
function [F, focal, radial, E] = Ffk7pt_LarssonMartyushev(x1, x2, center1, center2, method)
arguments
    x1 (3,7) double
    x2 (3,7) double
    center1 (1,2) double
    center2 (1,2) double
    method {mustBeMember(method, ["larsson", "martyushev"])} 
end
    
    % normalization
    s = 1000;
    T1 = diag([1/s,1/s,1]) * ...
         [1 0 -center1(1)
          0 1 -center1(2)
          0 0         1];
    T2 = diag([1/s,1/s,1]) * ...
         [1 0 -center2(1)
          0 1 -center2(2)
          0 0         1];
    x1 = T1*x1;
    x2 = T2*x2;        
 
    u1 = x1(1,:)'; 
    v1 = x1(2,:)'; 
    u2 = x2(1,:)';
    v2 = x2(2,:)';
    r1 = sum( x1(1:2,:).^2 )';
    r2 = sum( x2(1:2,:).^2 )';

    % nullspace
    %         f1,     f2, f3,     f4,     f5,   k*f3,    k^2,   k*f6,   k*f7,   k*f8, f6, f7,  f8,     k,  1          
    M = [ u1.*u2, u1.*v2, u1, u2.*v1, v1.*v2, u1.*r2, r1.*r2, v1.*r2, u2.*r1, v2.*r1, v1, u2,  v2, r1+r2,  ones(size(u1)) ];
    data = ( -M(:,1:7) \ M(:,8:end) )';

    
    % solve 7pt F+f+k problem
    F      = [];
    focal  = [];
    radial = [];
    E      = [];
    switch method
        case "larsson"
            sol = solver_relpose_7p_fr_elimf(data);
            ind = prod(~imag(sol), 1, 'native');
            sol = sol(:,ind);
            
            % recover solutions
            if ~isempty(sol)
                nsols  = size(sol,2);
                F      = zeros(3,3,nsols);
                focal  = zeros(1,nsols);
                radial = zeros(1,nsols);
                E      = zeros(3,3,nsols);
                valid  = true(1,nsols);
                
                for i = 1:nsols
                    f6 = sol(1,i);
                    f7 = sol(2,i);
                    f8 = sol(3,i);
                    f9 = 1;
                    l  = sol(4,i);
                    vv = [l*f6, l*f7, l*f8,  f6, f7, f8, l, f9];
                    f1 = vv*data(:,1);
                    f2 = vv*data(:,2);
                    f3 = vv*data(:,3);
                    f4 = vv*data(:,4);
                    f5 = vv*data(:,5);
            
                    tmp_F = [f1 f4 f7
                             f2 f5 f8
                             f3 f6 f9];
                    tmp_focal = focal_from_F(tmp_F);
                    if isempty(tmp_focal) || tmp_focal < 0
                        valid(i) = false;
                    else
                        % denormalization
                        radial(i) = l / s^2;
                        focal(i)  = s * tmp_focal;
                        tmp_F     = T2' * tmp_F * T1;
                        F(:,:,i)  = tmp_F / norm(tmp_F,'fro');
                        
                        K1 = [focal(i)       0 center1(1)
                                    0 focal(i) center1(2)
                                    0        0         1];
                        K2 = [focal(i)       0 center1(1)
                                    0 focal(i) center1(2)
                                    0        0         1];
                        
                        E_tmp = K2' * F(:,:,i) * K1;
                        E(:,:,i) = E_tmp / norm(E_tmp,'fro');
                    end
            
                    
                end
                F      = F(:,:,valid);
                E      = E(:,:,valid);
                focal  = focal(valid);
                radial = radial(valid);
            end

        case "martyushev"
            [C,M] = coefs_relpose_7p_fr(x2, x1);
            [v,w,x,y,z] = std_209x277_colpiv_relpose_7p_fr(C);
        
            
            if ~isempty(v)        
                % recover solutions
                nsols =  length(v);
                F      = zeros(3,3,nsols);
                focal  = zeros(1,nsols);
                radial = zeros(1,nsols);
                E      = zeros(3,3,nsols);
                valid  = true(1,nsols);
                
                for i = 1:nsols
                    if v(i) < 0
                        valid(i) = false;
                    else
                        tmp_focal = 1/sqrt(v(i));
                        m     = [w(i); w(i)*z(i); x(i); x(i)*z(i); y(i); y(i)*z(i); z(i); 1];
                        ff    = -M(1:5,:)*m;
                        tmp_F = [ff(1) ff(3) x(i); 
                                 ff(2) ff(4) y(i); 
                                 ff(5) w(i)  1];
                        % denormalization
                        radial(i) = z(i) / s^2;
                        focal(i)  = s * tmp_focal;
                        tmp_F     = T2' * tmp_F * T1;
                        F(:,:,i)  = tmp_F / norm(tmp_F,'fro');
                        
                        K1 = [focal(i)       0 center1(1)
                                    0 focal(i) center1(2)
                                    0        0         1];
                        K2 = [focal(i)       0 center1(1)
                                    0 focal(i) center1(2)
                                    0        0         1];
                        
                        E_tmp = K2' * F(:,:,i) * K1;
                        E(:,:,i) = E_tmp / norm(E_tmp,'fro');
                    end
            
                    
                end
                F      = F(:,:,valid);
                E      = E(:,:,valid);
                focal  = focal(valid);
                radial = radial(valid);
            end
    end

end

function sols = solver_relpose_7p_fr_elimf(data)
[C0,C1] = setup_elimination_template(data);
C1 = C0 \ C1;
RR = [-C1(end-49:end,:);eye(68)];
AM_ind = [112,6,17,18,19,20,21,22,23,24,2,25,26,27,1,28,29,30,5,4,3,31,32,33,95,8,34,35,36,37,38,39,7,40,41,42,43,94,10,9,44,45,46,11,12,107,104,103,13,47,...
48,49,14,105,106,15,108,109,110,111,16,113,114,115,116,117,118,50];
AM = RR(AM_ind,:);
[V,D] = eig(AM);
V = V ./ (ones(size(V,1),1)*V(1,:));
sols(1,:) = V(2,:);
sols(2,:) = V(25,:);
sols(3,:) = V(46,:);
sols(4,:) = diag(D).';
end
